import React from "react";
import { FaTachometerAlt,FaSearch, FaBox, FaUser, FaCogs } from "react-icons/fa";

import '../../App.css';


const Sidebar = () => {
  return (
    <div className="sidebar">
      <h2 className="sidebar-title">Admin Dashboard</h2>
      <ul className="sidebar-menu">
       
        <li className="active"><FaBox />chethan</li>
        <div className="search-box">
                 <FaSearch />
                 <input
                   type="text"
                   placeholder="Search item..."
                   
                 />
               </div>
        <h1>recent Activty user added remove ...</h1>
      </ul>
    </div>
  );
};

export default Sidebar;
